script: |
  super -f text -I q9624.spq | sort > q9624.out

inputs:
  - name: q9624.spq
    data: |
      SELECT ALL col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 95 / 8 * - col1 * + ( col0 ) + - 66 NOT IN ( + col1 / col1 + 68 );
  - name: tab2

outputs:
  - name: q9624.out
    data: |
      51
      67
      77
